sys_script_include.script:
var GetArea = Class.create();
// Extend the global.AbstractAjaxProcessor class
GetArea.prototype = Object.extendsObject(global.AbstractAjaxProcessor,{
	// Define the getEmail function.  
	// Create a GlideRecord for the User table.
	// Use the sysparm_userID passed from the client side to retrieve a record from the User table.
	// Return the email address for the requested record
	getvalue: function() {
		var userRecord = new GlideRecord("x_538229_realestat_property");
		userRecord.get(this.getParameter('sysparm_Property_id'));
		return userRecord.area + '';
	},
	type: 'GetArea'
});
